import React, { useState, useEffect } from 'react';
import DOWNLOAD from '../assets/DOWNLOAD.png';
import DYUKSHA from '../assets/DYUKSHA.png';
import NOOPURAM from '../assets/NOOPURAM23.png';
import RESUME from '../assets/ATS RESUME.pdf'

function Profile() {
  const [currentRole, setCurrentRole] = useState("ARJUN SAJEEV N");


  useEffect(() => {
    const roles = ["ARJUN SAJEEV N", "DEVELOPER", "DESIGNER", "PHOTOGRAPHER"];
    const interval = setInterval(() => {
      setCurrentRole((prevRole) => {
        const currentIndex = roles.indexOf(prevRole);
        const nextIndex = (currentIndex + 1) % roles.length;
        return roles[nextIndex];
      });
    }, 1500);

    return () => clearInterval(interval);
  }, []); 

  const handleResumeClick = () => {
    const resumeUrl = {RESUME}; // Replace with the actual path to your PDF
    window.open(resumeUrl, "_blank"); // Opens the PDF in a new tab
  };

  return (
    <div className='lg:px-20 md:px-16 pt-20 pb-2 xl:pb-20 grid grid-cols-3 gap-4'>
      <div className='text-md xl:text-3xl'>Hello,</div>
      <div className="flex flex-row col-span-3 justify-between grid-cols-3 ">
        <div className="flex flex-col col-start-3 ">
          <div className='lg:text-6xl md:text-5xl sm:text-5xl text-3xl'>I am </div> 
          <div className='lg:text-6xl md:text-5xl sm:text-5xl text-3xl'><span className='font-bold'>{currentRole}</span></div>

        </div>
        <div className="flex flex-col items-center sm:flex-row md:flex-col lg:flex-row xl:flex-row  lg:items-center md:items-center text-md xl:text-2xl border border-gray-800 rounded-lg p-4 hover:bg-zinc-800"
          >
          <a href={RESUME} onClick={handleResumeClick} target="_blank" rel="noopener noreferrer">
            <div className='flex sm:mr-4 item-center'>
              RESUME
            </div>
            <div className='content-center w-4 xl:w-auto'>
              <img src={DOWNLOAD} alt="" />
            </div>
          </a>
        </div>
      </div>
      <div className="col-span-3 text-md xl:">A Creative Graphic Designer and Web Developer.</div>
      <div className="col-span-3"></div>
      <div className="col-span-3"></div>
      <div className="col-span-3"></div>
      <div className="col-span-3"></div>
      <div className="col-span-3"></div>
      <div className="col-span-3"></div>
      <div className="col-span-3"></div>

      <div className='col-start-1 col-end-4 sm:col-end-3 text-3xl font-semibold'>
        <div>RECENT WORKS</div>
        <div className='grid grid-cols-2 gap-4 mt-4 px-4 '>
          <div className="">
          <a href="https://instagram.com/dyuksha.nssce" target="_blank" rel="noopener noreferrer"> 
            <div className=' row-span-full flex flex-row justify-center items-center border border-gray-800 rounded-lg p-4 hover:bg-zinc-800 hover:cursor-pointer'>    
              <img src={DYUKSHA} alt="" />
            </div>
          </a>
          </div>
          <div>
          <a href="https://instagram.com/noopuram_23" target="_blank" rel="noopener noreferrer"> 
            <div className='row-span-full flex flex-row justify-center items-center border border-gray-800 rounded-lg p-4 hover:bg-zinc-800 hover:cursor-pointer'>    
              <img src={NOOPURAM} alt="" />
            </div>
          </a>
          </div>
        </div>
      </div>

      <div className=" xxs:col-span-3 lg:col-span-1 xl:col-span-1 grid grid-cols-3 gap-4 ">
        <div className=" col-span-3 text-3xl gap-y-20 font-semibold ">SKILLS</div>
          <div className='border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>React</div>
          <div className='col-span-2 border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>Figma</div>
          <div className='col-span-2 border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>Frontend</div>
          <div className='border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>Database</div>
          <div className='border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>Backend</div>
          <div className='col-span-2 border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>Development</div>
          <div className='border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>JavaScript</div>
          <div className='border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>PostgreSQL</div>
          <div className='border border-gray-800 rounded-full p-1 xl:p-4 text-center hover:bg-zinc-800'>Node.js</div>
      </div>
    </div>
  );
}

export default Profile;
